INSERT INTO `v1_1b16174232fa41c75561fc9e055d2bbba7201939b8ea777845223fa8976e149c` VALUES (130211, 3002, -416.5, "2024/10/31 12:00:00", "2030/01/01 14:59:59", 1, 3002100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 0.0, 100, "フブキ", 0.0, 1);
